    <section className="roomslist">
      <div className="roomslist-center">
        {rooms.map(item => {
          niz.map(id=>{
            if(id==item.id) return <Room props={props} key={item.id} room={item} />;
          })
          
        })}
      </div>
    </section>
  );
};

export default RoomsList;
